import styles from "./Topbar.module.css";
const Topbar = () => {
  return (
    <div className={styles.top}>
      Top
      <div className={styles.topLeft}>1</div>
      <div className={styles.topCenter}>2</div>
      <div className={styles.topRight}>3</div>
    </div>
  );
};

export default Topbar;
